const maxFps = 30;

const defaultSpeed = 1;
const shipFriction = 0.85;
const projectileFriction = 0.95;

const starAmount = 2000;
const enemyAmount = 40;

const collisionSize = 50;
const projectileSpeed = 5;
const projectileTime = 20;

const score = document.getElementById("score");
const playButton = document.getElementById("playButton");
const canvas = document.getElementById("canvas");

function resize() {
    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;
}
window.onresize = resize;
resize();

const ctx = canvas.getContext("2d");

function normalize(x, y) {
    const magnitude = Math.sqrt(x * x + y * y);
    return {
        x: magnitude == 0 ? 0 : x / magnitude,
        y: magnitude == 0 ? 1 : y / magnitude
    }
}

class GameObject {
    constructor(posX, posY, imageIndex) {
        this.posX = posX;
        this.posY = posY;
        this.imageIndex = imageIndex;
        this.rot = 0;
        this.alpha = 1;
        this.screenPosX = 0;
        this.screenPosY = 0;
    }
    render() {
        ctx.save();
        ctx.setTransform(1, 0, 0, 1,
            Math.floor(this.posX - cameraPosX + canvas.width * 0.5),
            Math.floor(-this.posY + cameraPosY + canvas.height * 0.5)
        );
        ctx.rotate(this.rot);
        ctx.globalAlpha = this.alpha;
        ctx.drawImage(images[this.imageIndex], Math.floor(-images[this.imageIndex].width * 0.5), Math.floor(-images[this.imageIndex].height * 0.5));
        ctx.restore();
    }
}

class Star extends GameObject {
    constructor(respawn = true) {
        super((Math.random() - 0.5) * 10000, (Math.random() - 0.5) * 10000, 34);
        this.respawn = respawn;
        this.velocityX = 0;
        this.velocityY = 0;
    }
    tick() {
        for (let i = 0; i < ships.length; i++) {
            const distanceX = Math.abs(ships[i].posX - this.posX);
            const distanceY = Math.abs(ships[i].posY - this.posY);
            if (distanceX < collisionSize &&
                distanceY < collisionSize
            ) {
                ships[i].levelUp(Math.floor(Math.random() * 3) + 1);
                if (this.respawn) {
                    stars.push(new Star());
                }
                return true;
            }
            if (distanceX < collisionSize * (ships[i].level * 0.5 + 1.5)  &&
                distanceY < collisionSize * (ships[i].level * 0.5 + 1.5)
            ) {
                const movement = normalize(ships[i].posX - this.posX, ships[i].posY - this.posY);
                this.velocityX += movement.x * 3;
                this.velocityY += movement.y * 3;
            }
        }
        if (this.velocityX != 0 || this.velocityY != 0) this.move();
    }
    move() {
        this.velocityX *= shipFriction;
        this.velocityY *= shipFriction;
        this.posX += this.velocityX;
        this.posY += this.velocityY;
    }
}

class Ship extends GameObject {
    constructor(posX, posY, level, color) {
        super(posX, posY, level < 8 ? level * 3 + color : level + 16);
        this.level = level;
        this.xp = 0;
        this.color = color;
        this.velocityX = 0;
        this.velocityY = 0;
        this.speed = defaultSpeed;
        this.lastShot = performance.now();
    }
    move(targetX, targetY) {
        this.velocityX *= shipFriction;
        this.velocityY *= shipFriction;
        this.velocityX += targetX * this.speed;
        this.velocityY += targetY * this.speed;
        this.rot = Math.atan2(this.velocityX, this.velocityY);
        this.posX += this.velocityX;
        this.posY += this.velocityY;
        this.posX = Math.max(Math.min(this.posX, 5000), -5000);
        this.posY = Math.max(Math.min(this.posY, 5000), -5000);
    }
    shoot() {
        if (this == ships[player]) {
            audio[0].play();
        }
        if (performance.now() - this.lastShot > 200) {

            const speed = projectileSpeed * (this.level + 4);

            if (this.level > 5) {
                const direction = normalize(this.velocityX, this.velocityY);
                projectiles.push(new Projectile(this, this.posX - direction.y * 20, this.posY + direction.x * 20, speed));
                projectiles.push(new Projectile(this, this.posX + direction.y * 20, this.posY - direction.x * 20, speed));
            }
            else {
                projectiles.push(new Projectile(this, this.posX, this.posY, speed));
            }

            this.lastShot = performance.now();
            const knockBack = normalize(this.velocityX, this.velocityY);

            if (Math.abs(knockBack.x * 6) < Math.abs(this.velocityX * 0.99)) {
                this.velocityX -= knockBack.x * 6;
            }
            else {
                this.velocityX -= this.velocityX * 0.99;
            }

            if (Math.abs(knockBack.y * 6) < Math.abs(this.velocityY * 0.99)) {
                this.velocityY -= knockBack.y * 6;
            }
            else {
                this.velocityY -= this.velocityY * 0.99;
            }
        }
    }
    levelUp(xp) {
        const requiredXp = 100 + this.level * 50;
        this.xp += xp;
        if (this.xp >= requiredXp) {
            this.xp -= requiredXp;
            this.level++;
            this.imageIndex = this.level < 8 ? this.level * 3 + this.color : this.level + 16;
        }
        if (this == ships[player] && score.innerHTML != "You won!") {
            score.innerHTML = "EXP: " + this.xp + " / " + (100 + this.level * 50);
        }
    }
}

class Player extends Ship {
    constructor(posX, posY) {
        super(posX, posY, 0, 0);
    }
    tick() {
        const inputX = mousePosX - (mouse ? canvas.width * 0.5 : controllerPosX);
        const inputY = mousePosY + (mouse ? canvas.height * 0.5 : controllerPosY);
        const normalized = normalize(inputX, inputY);
        if (!mouse) drawController(normalized.x, normalized.y);
        this.move(normalized.x, normalized.y);
        this.render();
    }
}

class Enemy extends Ship {
    constructor() {
        const posX = (Math.random() - 0.5) * 10000;
        const posY = (Math.random() - 0.5) * 10000;
        const isVisible = Math.abs(cameraPosX - posX) < canvas.width && Math.abs(cameraPosY - posY) < canvas.height;
        const level = isVisible ? 0 : Math.floor(Math.random() * Math.random() * Math.random() * 17);
        super(posX, posY, level, Math.floor(Math.random() * 2) + 1);
        this.targetShip = null;
        this.targetStar = null;
        this.targetX = null;
        this.targetY = null;
    }
    tick() {
        if (ships[this.targetShip] == null) {
            this.targetShip = Math.floor(Math.random() * ships.length);
        }
        if (ships[this.targetShip] == this) {
            this.targetShip = null;
        }
        else if (
            Math.abs(this.posX - ships[this.targetShip].posX) > canvas.width * 0.5 ||
            Math.abs(this.posY - ships[this.targetShip].posY) > canvas.height * 0.5
        ) {
            this.targetShip = null;
        }
        if (ships[this.targetShip]) {
            const normalizedTarget = normalize(ships[this.targetShip].posX - this.posX, ships[this.targetShip].posY - this.posY)
            this.targetX += normalizedTarget.x * 0.05;
            this.targetY += normalizedTarget.y * 0.05;
            ({ x: this.targetX, y: this.targetY } = normalize(this.targetX, this.targetY));

            const normalizedVelocity = normalize(this.velocityX, this.velocityY);
            if (Math.abs(normalizedTarget.x - normalizedVelocity.x) < 0.1 &&
                Math.abs(normalizedTarget.y - normalizedVelocity.y) < 0.1
            ) {
                this.shoot();
            }
        }
        else {
            if (stars[this.targetStar] == null) {
                this.targetStar = Math.floor(Math.random() * stars.length);
            }
            const normalizedTarget = normalize(stars[this.targetStar].posX - this.posX, stars[this.targetStar].posY - this.posY)
            this.targetX += normalizedTarget.x * 0.05;
            this.targetY += normalizedTarget.y * 0.05;
            ({ x: this.targetX, y: this.targetY } = normalize(this.targetX, this.targetY));
        }
        this.move(this.targetX, this.targetY);
        this.render();
    }
}

class Projectile extends GameObject {
    constructor(ship, posX, posY, speed) {
        super(posX, posY, 33);
        this.ship = ship;
        const direction = normalize(ship.velocityX, ship.velocityY);
        this.rot = Math.atan2(direction.x, direction.y);
        this.velocityX = direction.x * speed;
        this.velocityY = direction.y * speed;
        this.time = projectileTime;
    }
    move() {
        if (ships.indexOf(this.ship) == -1) return true;

        this.posX += this.velocityX;
        this.posY += this.velocityY;

        this.velocityX *= projectileFriction;
        this.velocityY *= projectileFriction;
        if (this.time < 1) {
            return true;
        }
        this.time--;
        this.alpha = 1 - Math.pow(1 - this.time / projectileTime, 2);
        if (this.time % 2 == 0) {
            for (let i = 0; i < ships.length; i++) {
                if (ships[i] == this.ship) continue;
                if (Math.abs(ships[i].posX - this.posX) < collisionSize &&
                    Math.abs(ships[i].posY - this.posY) < collisionSize
                ) {
                    const posX = ships[i].posX;
                    const posY = ships[i].posY;
                    const level = ships[i].level;
                    ships.splice(i, 1);
                    if (player == i) {
                        player = null;
                        menu();
                    }
                    else {
                        ships.push(new Enemy());
                    }
                    if (player > i) {
                        player--;
                    }
                    for (let i = 0; i < 10 * (level + 2); i++) {
                        const star = new Star(false);
                        stars.push(star);
                        star.posX = posX;
                        star.posY = posY;
                        const velocity = normalize(Math.random(), Math.random());
                        const speed = (Math.random() * 2 - 1) * 20 + 5 * level;
                        star.velocityX = velocity.x * speed;
                        star.velocityY = velocity.y * speed;
                    }
                    return true;
                }
            }
        }
        return false;
    }
}

let mouse = true;
let frameStart;

let cameraPosX = 0;
let cameraPosY = 0;

let space = false;
let mousePosX = 0;
let mousePosY = 0;

let controllerPosX = canvas.width - 100;
let controllerPosY = canvas.height - 100;

let player;
const ships = [];
const stars = [];
const projectiles = [];

let background;
let images;

(async () => {
    images = await Promise.all(imageSources.map(src => new Promise(resolve => {
        const image = new Image();
        image.onload = () => resolve(image);
        image.src = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA" + src;
    })));
    background = ctx.createPattern(images[0], "repeat");
    for (let i = 0; i < enemyAmount; i++) {
        ships.push(new Enemy());
    }
    for (let i = 0; i < starAmount; i++) {
        stars.push(new Star());
    }

    frameStart = performance.now();

    requestAnimationFrame(render);
    menu();
})();

function menu() {
    window.onmousemove = null;
    canvas.onpointerdown = null;
    window.ontouchmove = null;
    playButton.onpointerdown = start;
}

function updateMousePos(evt) {
    const rect = canvas.getBoundingClientRect();
    mousePosX = evt.clientX - rect.left;
    mousePosY = -evt.clientY + rect.top;
}

function start(evt) {
    canvas.onpointerdown = null;
    updateMousePos(evt);
    mouse = evt.pointerType === "mouse";
    if (mouse) {
        window.onmousemove = updateMousePos;
        canvas.onpointerdown = function () {
            ships[player].shoot();
        };
    }
    else {
        window.ontouchmove = function (evt) {
            const rect = canvas.getBoundingClientRect();
            mousePosX = evt.changedTouches[0].clientX - rect.left;
            mousePosY = -evt.changedTouches[0].clientY + rect.top;
        };
    }
    player = ships.length;
    ships[player] = new Player(0, 0);
}

function clear() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
}

function drawController(x, y) {
    ctx.fillStyle = "gray";
    ctx.beginPath();
    ctx.arc(controllerPosX, controllerPosY, 80, 0, 2 * Math.PI);
    ctx.fill();
    ctx.fillStyle = "lightgray";
    ctx.beginPath();
    ctx.arc(controllerPosX + x * 40, controllerPosY - y * 40, 40, 0, 2 * Math.PI);
    ctx.fill();
}

function render() {
    clear();

    if (ships[player]) {
        cameraPosX += (ships[player].posX - cameraPosX) * 0.1;
        cameraPosY += (ships[player].posY - cameraPosY) * 0.1;
    }
    else {
        cameraPosX += (ships[0].posX - cameraPosX) * 0.1;
        cameraPosY += (ships[0].posY - cameraPosY) * 0.1;
    }

    ctx.strokeStyle = "#1a1a1a";
    const lineWidth = canvas.width * 0.5;
    ctx.lineWidth = lineWidth;
    ctx.strokeRect(-5000 + canvas.width * 0.5 - lineWidth * 0.5 - Math.floor(cameraPosX), -5000 + canvas.height * 0.5 - lineWidth * 0.5 + Math.floor(cameraPosY), 10000 + lineWidth, 10000 + lineWidth);
    canvas.style["background-position"] = -Math.floor(cameraPosX) + "px " + Math.floor(cameraPosY) + "px";

    for (let i = 0; i < stars.length; i++) {
        if (stars[i].tick()) {
            stars.splice(i, 1);
            i--;
            continue;
        }
        stars[i].render();
    }
    for (let i = 0; i < projectiles.length; i++) {
        if (projectiles[i].move()) {
            projectiles.splice(i, 1);
            i--;
            continue;
        }
        projectiles[i].render();
    }
    for (let i = 0; i < ships.length; i++) {
        if (i == player) continue;
        ships[i].tick();
    }
    if (ships[player]) {
        ships[player].tick();
    }

    const timeSinceLastFrame = performance.now() - frameStart;
    if (timeSinceLastFrame < 1000 / maxFps) {
        setTimeout(function () {
            frameStart = performance.now();
            requestAnimationFrame(render);
        }, 1000 / maxFps - timeSinceLastFrame);
    }
    else {
        console.log("skip");
        frameStart = performance.now();
        requestAnimationFrame(render);
    }
}